import React from 'react';
import './App.css';

import legend from "./LegendData"
import Rect from "./LegendRect.js"

function App() {

  let Legend = legend.map(d, i => {
  	console.log(d)
  	return <Rect
    key = {d.id}
    color = {d.color}
    category = {d.category}
    x = '10'
    y = '20'
    width = {20}
    height = {20}
    />
  })

  return (
    <div>
      {Legend}
    </div>
  );
}

export default App;
